import Counter from './Counter'

class CounterPanel extends Component {
    render() {
        return (
            <Fragment>
                <Counter caption={'First'} />
                <Counter caption={'Second'} />
                <Counter caption={'Third'} />
            </Fragment>
        )
    }
}

export default CounterPanel;
